import './topbar.css';
import { logo } from '../../dummyData';

export default function Topbar() {
  return (
    <div className='topbar'>
        <div className="topbarLogo">
            <img src="https://cvws.icloud-content.com/B/AYl1dmvzz1UUHpgv5nzXQ4Rr7SSDAZa9kqmuRgtqDwbx4vBGNULWoz_9/logo.png?o=ArIlaypGPJjiatFtHtoZdQ5tjW5vIndL4cQRB86JlRc8&v=1&x=3&a=CAogYrM3F1UuKqxvlxJoY6lv_OEon8Yknmfc9Y2Vq0yacdgSbxC-z5OU9S8Y3sbKlPUvIgEAUgRr7SSDWgTWoz_9aieWewdcGU9lKmIf_wy7vdTzUtC5EPmDbb07qX12g6mMgFscI9W7jelyJw8sh0XiXgzYBSFQUj_RJEjE6VbosN5nNDl0I8hxLNBLBBwyTD_Eew&e=1646357816&fl=&r=87fcceab-0b70-4f57-8f8a-d104d6baf5bf-1&k=foE9DW1IIU3SGxuU4DiULA&ckc=com.apple.clouddocs&ckz=com.apple.CloudDocs&p=72&s=rp9OyNkyWoVZgXnV6F-TfBHm1j4&cd=i" alt="logo" className="topbarLogoImg" />
        </div>
    </div>
  )
}
